    void testReadOnlyConfigurationLifecycle() throws Exception {
        // Step 0: Establish a fresh connection pooling system with no initial read-only preference configured
        PerUserPoolDataSource connectionPoolingSystem = new PerUserPoolDataSource(); // Changed instantiation

        // Step 1: Check the current read-only preference for the default user pool
        // Step 2: Verify the read-only setting is absent
        Boolean readOnlyPreferenceStatus = connectionPoolingSystem.isDefaultReadOnly();
        Assertions.assertNull(readOnlyPreferenceStatus, "Initial read-only preference should be absent (null)");

        // Step 3: Enable read-only mode for the default user pool
        connectionPoolingSystem.setDefaultReadOnly(true);

        // Step 4: Confirm the system reflects an enabled read-only state for the default user pool
        Assertions.assertTrue(connectionPoolingSystem.isDefaultReadOnly(), "Read-only preference should be enabled (true)");

        // Step 5: Disable read-only mode for the default user pool
        connectionPoolingSystem.setDefaultReadOnly(false);

        // Step 6: Ensure the system reports a disabled read-only state for the default user pool
        Assertions.assertFalse(connectionPoolingSystem.isDefaultReadOnly(), "Read-only preference should be disabled (false)");

        // Step 7: Re-enable read-only mode for the default user pool
        connectionPoolingSystem.setDefaultReadOnly(true);

        // Step 8: Verify the system reflects an enabled read-only state for the default user pool
        Assertions.assertTrue(connectionPoolingSystem.isDefaultReadOnly(), "Read-only preference should be re-enabled (true)");

        // Step 9: Clear the read-only preference for the default user pool
